commit_message:
Add neutron/mesh role handling

* Add 'neutron/mesh' role handling for GRE segmentation type in
  'NeutronNetworkDeploymentSerializer70.generate_network_scheme';
* Extract base test class 'BaseTestDeploymentAttributesSerialization70';
* Add 'TestDeploymentAttributesSerializationSegmentationVlan70' test case;
* Remove hardcoded values with consts.NEUTRON_SEGMENT_TYPES in
  'neutron_serializers.py' and 'test_orchestrator_serializer_70.py'.

Change-Id: I2a881c4fbd6e4b9aea4430b382e0f13ab9655911
Implements: blueprint templates-for-networking
